import Vue from 'vue';
import Router from 'vue-router';
import HelloContainer from "./components/HelloWorld.vue";
import Exam01 from "./components/Exam01.vue";
import ExamMessageBox02 from "./components/ExamMessageBox02.vue";
import ExamField03 from "./components/ExamField03.vue";
import Login from "./components/Login.vue";
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    component: HelloContainer
  }, {
    path: '/Exam01',
    component: Exam01
  }, {
    path: '/ExamMessageBox02',
    component: ExamMessageBox02
  }, {
    path: '/ExamField03',
    component: ExamField03
  }, {
    path: '/Login',
    component: Login
  }]
});
